import {FirstName,LastName} from './Context';

const CompC = () =>{
 return(
     <>
        <FirstName.Consumer>
            {(fname) =>{
            return(
                <LastName.Consumer>
                    {(lname) => {
                        return
                        (
                            <h1>hii {fname} {lname} </h1>
                        );
                    }
                    }
                </LastName.Consumer>
                    );
                }   
            }
        </FirstName.Consumer>
     </>
 );

};
export default CompC;
